import '../linkedIn.css';
import '../linkedInFeed.css';
import '../icomoon/style.css';

import thumbs_up from '../images/thumbs-up.png';
import thumbs_up_filled from '../images/thumbs-up_filled.png';
import messages_up from '../images/messages-up.png';
import messages_up_filled from '../images/messages-up_filled.png';

function ThumbsUp(props) {
    if (props.checked) {
        return (
            <div className="post-buttons__button">
                <img src={thumbs_up_filled} className="post-buttons__icon"/>
                <span className="font-size_12">{props.amount}</span>
            </div>
        );
    } else {
        return (
            <div className="post-buttons__button">
                <img src={thumbs_up} className="post-buttons__icon"/>
                <span className="font-size_12">{props.amount}</span>
            </div>
        );
    }
}

function Messages(props) {
    if (props.checked) {
        return (
            <div className="post-buttons__button">
                <img src={messages_up_filled} className="post-buttons__icon"/>
                <span className="font-size_12">{props.amount}</span>
            </div>
        );
    } else {
        return (
            <div className="post-buttons__button">
                <img src={messages_up} className="post-buttons__icon"/>
                <span className="font-size_12">{props.amount}</span>
            </div>
        );
    }
}

function PostButtonsBar(props) {
    return (
        <div className="post-buttons__block">
            <ThumbsUp checked={props.thumbs_checked} amount={props.thumbs_amount}/>
            <Messages checked={props.messages_checked} amount={props.messages_amount}/>
            <div className="post-buttons__share">
                <img src={messages_up} className="post-buttons__icon"/>
                <span className="regular-text header-text_style">SHARE</span>
            </div>
        </div>
    );
}

export default PostButtonsBar;
